// ==UserScript==
// @name         ORCBin Modernify
// @namespace    http://tampermonkey.net/
// @version      1.6-1
// @description  Replace ORCBin title with base64 logo and use transparent links
// @match        *://*orcbin.com/*
// @grant        GM_addStyle
// @downloadURL https://update.greasyfork.org/scripts/534838/ORCBin%20Modernify.user.js
// @updateURL https://update.greasyfork.org/scripts/534838/ORCBin%20Modernify.meta.js
// ==/UserScript==

(function () {
    'use strict';

    GM_addStyle(`
        @import url('https://fonts.googleapis.com/css2?family=Inter:wght@400;600;800&display=swap');

        body {
            font-family: 'Inter', sans-serif !important;
            background: linear-gradient(to right, #001f3f, #003366);
            color: #ffffff !important;
            margin: 0;
            padding: 40px 20px;
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
        }

        #container {
            background: transparent !important;
            box-shadow: none !important;
            border: none !important;
            padding: 0 !important;
            width: 100%;
            max-width: 900px;
            text-align: center;
        }

        h1 {
            display: none;
        }

        .orcbin-logo {
            width: 400px;
            height: auto;
            margin: -40px auto 20px auto;
            animation: fadeIn 2s ease-in-out;
        }

        .highlight-banner {
            display: block;
            background: linear-gradient(90deg, #ff6ec4, #7873f5);
            color: white !important;
            padding: 12px;
            border-radius: 12px;
            font-weight: bold;
            margin-bottom: 20px;
            font-size: 1.2rem;
            animation: fadeIn 2s ease-in-out;
        }

        p {
            font-size: 1.1rem;
            line-height: 1.6;
            padding: 14px 22px;
            margin: 20px 0;
            border-radius: 12px;
            background: linear-gradient(to right, #1a1a1a, #333333);
            color: #ffffff !important;
            border: none !important;
            box-shadow: 0 2px 8px rgba(0, 0, 0, 0.4);
        }

        .nav-container {
            background: transparent !important;
            padding: 20px;
            border-radius: 14px;
            margin-top: 20px;
            margin-bottom: 30px;
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
            gap: 12px;
        }

        .nav-container a {
            display: inline-block;
            padding: 12px 24px;
            font-size: 1rem;
            font-weight: 600;
            color: #ffffff !important;
            background: transparent;
            border: none;
            border-radius: 10px;
            text-decoration: none !important;
            transition: all 0.3s ease;
            text-shadow: 0 1px 2px rgba(0,0,0,0.3);
        }

        .nav-container a:hover {
            background: rgba(255, 255, 255, 0.05);
            transform: scale(1.05);
        }

        .footer-banner {
            margin-top: 30px;
            font-size: 1rem;
            color: #aaa !important;
        }

        @keyframes fadeIn {
            from { opacity: 0; transform: translateY(-10px); }
            to { opacity: 1; transform: translateY(0); }
        }
    `);

    // Replace <h1> with base64 logo
    const h1 = document.querySelector('h1');
    if (h1) {
        const img = document.createElement('img');
        img.src = 'data:image/png;base64,';
        img.alt = 'ORCBin Logo';
        img.className = 'orcbin-logo';
        h1.replaceWith(img);
    }

    // Convert marquees to banners
    const marquees = document.querySelectorAll('marquee');
    marquees.forEach(marquee => {
        const banner = document.createElement('div');
        banner.className = 'highlight-banner';
        banner.textContent = marquee.textContent;
        marquee.replaceWith(banner);
    });

    // Style and rewrap links
    const links = Array.from(document.querySelectorAll('a')).filter(link =>
        link.offsetParent !== null && link.textContent.trim().length > 0
    );

    if (links.length > 0) {
        const navContainer = document.createElement('div');
        navContainer.className = 'nav-container';

        links.forEach(link => {
            const cloned = link.cloneNode(true);
            navContainer.appendChild(cloned);
            link.style.display = 'none';
        });

        document.body.insertBefore(navContainer, document.body.children[1]);
    }
})();
